    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Trustom Pond NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Trustom Pond NWR will
    contribute to the overall mission of the Refuge System. The plan provides an introduction
    to the Refuge, an overview of the planning process, a description of Refuge resources,
    information on the management direction, and strategies for implementation and monitoring.
    Key planning issues include: protecting endangered species, restoration of coastal
    sandplain communities, restoration of beach strand communities, restoration of wetlands,
    control of invasive species, protection of biologically significant areas, and public
